// API-key здесь буду хранить и список контрактов


const updateSession = (state, action) =>{

    if (state === undefined )
        return { contracts: []  }

    switch(action.type){
        case 'ADD_CONTRACTS':
            return {...state,  contracts: action.payload}

    }


}

export default updateContracts;
